%% MATLAB 遗传算法解决旅行商问题 (TSP) 代码

% 清理工作区和命令行窗口
clear;
clc;

% 1. 定义坐标
% 基地坐标 (经度, 纬度)
base = [70, 40]; 

% 目标坐标 (经度, 纬度) 来自提供的数据
% 共有20个目标。数据以 (经度, 纬度) 对的形式呈现。
targets = [
    51.1758, 0.0322;    48.2077, 16.8889;  % 
    15.2548, 27.2111;   35.6619, 9.9333;   % 
    0.7732, 0.4656;     26.7213, 28.5667;  % 
    58.6849, 27.1485;   30.8165, 13.4595;  % 
    8.9586, 24.6635;    26.4951, 22.1221;  % 
    13.7909, 1.9510;    38.4722, 20.1731;  % 
    58.8289, 14.5229;   18.6635, 6.7436;   % 
    1.3496, 16.8359;    52.8423, 27.2880;  % 
    11.5118, 17.3884;   4.1591, 3.1853;    % 
    0.9718, 28.1477;    4.9568, 8.3669     % 
];

% 将基地和目标合并到一个点集中。基地将是第一个点。
all_points = [base; targets];
num_points = size(all_points, 1);
num_targets = size(targets, 1);

% 飞机速度
speed = 1000; % 公里/小时 

% 2. 计算距离矩阵
% 我们将使用欧几里得距离来计算点之间的距离。
% 考虑到问题背景（假设为作业，未提及地球半径或球面计算），
% 欧几里得距离是一个合理的简化。
% 如果需要精确的地理距离，则应实现Haversine公式。

dist_matrix = zeros(num_points, num_points);
for i = 1:num_points
    for j = 1:num_points
        if i == j
            dist_matrix(i, j) = 0;
        else
            % 欧几里得距离
            dist_matrix(i, j) = sqrt((all_points(i, 1) - all_points(j, 1))^2 + ...
                                     (all_points(i, 2) - all_points(j, 2))^2);
        end
    end
end

% 3. 遗传算法设置

% 遗传算法参数
pop_size = 500; % 种群大小
num_generations = 2000; % 迭代代数
mutation_rate = 0.02; % 变异率

% 初始化种群
% 每个染色体代表目标索引（2到num_points）的一个排列
% 基地（索引1）始终是起点和终点。
population = zeros(pop_size, num_targets);
for i = 1:pop_size
    population(i, :) = randperm(num_targets); % 目标索引的排列
end

% 存储最佳路线和每代的适应度
best_route_overall = [];
min_time_overall = Inf;
best_fitness_history = zeros(num_generations, 1);

% 4. 遗传算法主循环
for gen = 1:num_generations
    fitness = zeros(pop_size, 1);
    current_times = zeros(pop_size, 1);

    % 评估每个染色体的适应度
    for i = 1:pop_size
        current_chromosome_indices = [1, population(i, :) + 1, 1]; % 在起点和终点添加基地
        
        % 计算当前路线的总距离
        total_dist = 0;
        for k = 1:(num_targets + 1)
            total_dist = total_dist + dist_matrix(current_chromosome_indices(k), current_chromosome_indices(k+1));
        end
        
        % 计算总时间 (距离 / 速度)
        current_time = total_dist / speed;
        current_times(i) = current_time;
        
        % 适应度函数：最小化时间，因此适应度为 1/时间
        fitness(i) = 1 / current_time;
    end

    % 找到当前代中最佳路线
    [max_fitness_gen, idx] = max(fitness);
    current_best_time = current_times(idx);

    if current_best_time < min_time_overall
        min_time_overall = current_best_time;
        best_route_overall = [1, population(idx, :) + 1, 1]; % 存储实际点索引
    end
    best_fitness_history(gen) = 1 / min_time_overall; % 存储 1/最小时间 以供绘图

    % 选择 (轮盘赌选择)
    new_population = zeros(pop_size, num_targets);
    normalized_fitness = fitness / sum(fitness);
    cumulative_fitness = cumsum(normalized_fitness);

    for i = 1:pop_size
        r = rand();
        selected_idx = find(cumulative_fitness >= r, 1, 'first');
        new_population(i, :) = population(selected_idx, :);
    end
    population = new_population;

    % 交叉 (顺序交叉 - OX1)
    for i = 1:2:pop_size - 1 %成对选择父代
        parent1 = population(i, :);
        parent2 = population(i+1, :);

        % 选择两个随机切割点
        cut_points = sort(randperm(num_targets - 1, 2));
        cut1 = cut_points(1);
        cut2 = cut_points(2);

        % 创建子代
        child1 = zeros(1, num_targets);
        child2 = zeros(1, num_targets);

        % 将父代1的片段复制到子代1，父代2的片段复制到子代2
        child1(cut1:cut2) = parent1(cut1:cut2);
        child2(cut1:cut2) = parent2(cut1:cut2);

        % 从父代2填充子代1的剩余基因
        fill_idx = [1:cut1-1, cut2+1:num_targets];
        parent2_remaining = parent2(~ismember(parent2, child1));
        child1(fill_idx) = parent2_remaining(1:length(fill_idx));

        % 从父代1填充子代2的剩余基因
        parent1_remaining = parent1(~ismember(parent1, child2));
        child2(fill_idx) = parent1_remaining(1:length(fill_idx));
        
        population(i, :) = child1;
        population(i+1, :) = child2;
    end

    % 变异 (交换变异)
    for i = 1:pop_size
        if rand() < mutation_rate
            % 选择两个随机位置进行交换
            swap_points = randperm(num_targets, 2);
            pos1 = swap_points(1);
            pos2 = swap_points(2);

            temp = population(i, pos1);
            population(i, pos1) = population(i, pos2);
            population(i, pos2) = temp;
        end
    end
end

%% 5. 结果
fprintf('优化完成！\n'); %[output:1d7bcc03]
fprintf('侦察所需的最短总时间：%.2f 小时\n', min_time_overall); %[output:6f69db94]
fprintf('最佳路线（all_points 的索引，以基地为起点和终点）：\n'); %[output:13292bd5]
disp(best_route_overall); %[output:10b3d453]

% 将索引转换为坐标以便绘图
best_route_coords = all_points(best_route_overall, :);

%% 6. 可视化
figure; %[output:928bc894]
plot(all_points(:, 1), all_points(:, 2), 'o', 'MarkerFaceColor', 'b'); % 所有点 %[output:928bc894]
hold on; %[output:928bc894]
plot(base(1), base(2), 's', 'MarkerFaceColor', 'r', 'MarkerSize', 10); % 基地 %[output:928bc894]
text(base(1) + 0.5, base(2) + 0.5, '基地 (70,40)', 'Color', 'r', 'FontSize', 10);  %[output:928bc894]

% 绘制目标编号
for i = 1:num_targets
    text(targets(i, 1) + 0.5, targets(i, 2) + 0.5, num2str(i), 'Color', 'k', 'FontSize', 8); %[output:928bc894]
end

% 绘制最佳路线
plot(best_route_coords(:, 1), best_route_coords(:, 2), '-r', 'LineWidth', 1.5); %[output:928bc894]
title('最优侦察路线 (遗传算法)'); %[output:928bc894]
xlabel('经度'); %[output:928bc894]
ylabel('纬度'); %[output:928bc894]
grid on; %[output:928bc894]
hold off; %[output:928bc894]

figure; %[output:7fc591f0]
plot(1:num_generations, best_fitness_history); %[output:7fc591f0]
title('最佳适应度 (1/时间) vs. 代数'); %[output:7fc591f0]
xlabel('代数'); %[output:7fc591f0]
ylabel('最佳适应度'); %[output:7fc591f0]
grid on; %[output:7fc591f0]

